from typing import *
def f_gold(candidates: List[int], target: int) -> List[List[int]]:
    def dfs(s, u, t):
        if s == target:
            ans.append(t[0])
            return
        if s > target:
            return
        for i in range(u, len(candidates)):
            c = candidates[i]
            t.append(c)
            dfs(s + c, i, t)
            t.pop()
    ans = []
    dfs(0, 0, [])
    return ans

